---
apiVersion: v1
kind: Service
metadata:
  labels:
    app: httpbin-0
  name: httpbin-0
spec:
  ports:
  - name: http
    port: 8000
    targetPort: 80
  selector:
    app: httpbin-0
---
apiVersion: apps/v1
kind: Deployment
metadata:
  name: httpbin-0
spec:
  replicas: 1
  selector:
    matchLabels:
      app: httpbin-0
      version: v1
  strategy:
    rollingUpdate:
      maxSurge: 10
      maxUnavailable: 10
  template:
    metadata:
      labels:
        app: httpbin-0
        version: v1
    spec:
      containers:
      - image: docker.io/kennethreitz/httpbin
        imagePullPolicy: IfNotPresent
        name: httpbin-0
        ports:
        - containerPort: 80

